import { CampaingPageContainer, TabsContainer, ContentContainer } from './styles'
import { useEffect, useState } from 'react'
import { User } from '../../models/user'
import { loadCampaing } from '../../services'
import { useLocation, useParams } from 'react-router-dom'
import Tab from '../../components/Tab'
import HeaderCampaing from '../../components/CampaingElements/HeaderCampaing/HeaderCampaing'
import { CampaingDataModel } from '../../models/campaing-data'
import ClicksTab from './ClicksTab'

interface Props {
  user?: User []
}

const CampaingPage = ({ user }: Props) => {
  const [campaingData, setCampaingData] = useState<CampaingDataModel>()
  const { idCampaing } = useParams()
  const { state } = useLocation();
  const { name } = state
  console.log(name)

  useEffect(() => {
    if(user) {
      loadCampaing(Number(idCampaing), user[0].tokenAccess)
      .then(resp => {
        console.log('hello: ',resp)
        setCampaingData(resp.data)
      })
      .catch(error => {
        console.log(error)
      })
    }
  }, [user, idCampaing])

  return (
    <CampaingPageContainer>
      {campaingData? (
        <>
          <HeaderCampaing idCampaing={Number(idCampaing)} name={name} user={user} />

          <ContentContainer>
            <TabsContainer>
              <Tab text='Clicks' isSelected={true} onClick={() => {}} />
            </TabsContainer>

            <ClicksTab user={user} campaingData={campaingData} />
          </ContentContainer>
        </>
      ) : (
        ''
      )}

    </CampaingPageContainer>
  )
}

export default CampaingPage
